def move(direction, pos):
    if direction == 'U':
        temp = (pos[0], pos[1] + 1)
    elif direction == 'D':
        temp = (pos[0], pos[1] - 1)
    elif direction == 'R':
        temp = (pos[0] + 1, pos[1])
    elif direction == 'L':
        temp = (pos[0] - 1, pos[1])
    else:
        raise Exception

    if abs(temp[0]) + abs(temp[1]) > 2:
        return pos
    else:
        return temp


def convert_position_to_number(pos):
    if pos == (0, 2):
        return '1'
    elif pos == (-1, 1):
        return '2'
    elif pos == (0, 1):
        return '3'
    elif pos == (1, 1):
        return '4'
    elif pos == (-2, 0):
        return '5'
    elif pos == (-1, 0):
        return '6'
    elif pos == (0, 0):
        return '7'
    elif pos == (1, 0):
        return '8'
    elif pos == (2, 0):
        return '9'
    elif pos == (-1, -1):
        return 'A'
    elif pos == (0, -1):
        return 'B'
    elif pos == (1, -1):
        return 'C'
    elif pos == (0, -2):
        return 'D'
    else:
        print(pos)
        raise Exception


def process(data):
    pos = (-2, 0)

    for d in data:
        for direction in d:
            pos = move(direction, pos)

        print(convert_position_to_number(pos), end='')

for data in [test1, data]:
    process(data)
    print()
